export default async function ({ addon, msg, console }) {
  var oldTitle = document.title;
  setInterval(async () => {
    const svg;
    if (addon.account.getMsgCount() !== 0) {
      svg = `<svg height="133.33691"><g transform="translate(-193.25786,-115.48779)"><image x="865.07548" y="516.95521" transform="scale(0.2234,0.2234)" width="390" height="560" xlink:href="data:image/png;base64," fill="none" stroke="none" stroke-width="0.5"></image><path d="M226.51874,214.40061c0,-16.6306 13.4811,-30.1117 30.1117,-30.1117c16.6298,0 30.1117,13.4811 30.1117,30.1117c0,16.6298 -13.4819,30.1116 -30.1117,30.1116c-16.6306,0 -30.1117,-13.4818 -30.1117,-30.1116z" fill="#e03a3a" stroke="#ffffff" stroke-width="8.625"></path></g></svg>`;
    } else {
      svg = `<svg height="133.33691"><g transform="translate(-193.25786,-115.48779)"><image x="865.07548" y="516.95521" transform="scale(0.2234,0.2234)" width="390" height="560" xlink:href="data:image/png;base64," fill="none" stroke="none" stroke-width="0.5"></image></g></svg>`;
    }

    var favicon_link_html = document.createElement("link");
    favicon_link_html.rel = "icon";
    favicon_link_html.href = svgToDataUri(svg);
    favicon_link_html.type = "image/svg+xml";

    let favicons = document.querySelectorAll('link[rel~="icon"]');
    favicons.forEach(function (favicon) {
      favicon.parentNode.removeChild(favicon);
    });

    const head = document.getElementsByTagName("head")[0];
    head.insertBefore(favicon_link_html, head.firstChild);
  }, 1000);
}
function replaceAll(str, find, replace) {
  return str.replace(new RegExp(find.replace(/([.*+?^=!:${}()|\[\]\/\\])/g, "\\$1"), "g"), replace);
}

function svgToDataUri(svg) {
  // these may not all be needed - used to be for uri-encoded svg in old browsers
  var encoded = svg.replace(/\s+/g, " ");
  encoded = replaceAll(encoded, "%", "%25");
  encoded = replaceAll(encoded, "> <", "><"); // normalise spaces elements
  encoded = replaceAll(encoded, "; }", ";}"); // normalise spaces css
  encoded = replaceAll(encoded, "<", "%3c");
  encoded = replaceAll(encoded, ">", "%3e");
  encoded = replaceAll(encoded, '"', "'"); // normalise quotes ... possible issues with quotes in <text>
  encoded = replaceAll(encoded, "#", "%23"); // needed for ie and firefox
  encoded = replaceAll(encoded, "{", "%7b");
  encoded = replaceAll(encoded, "}", "%7d");
  encoded = replaceAll(encoded, "|", "%7c");
  encoded = replaceAll(encoded, "^", "%5e");
  encoded = replaceAll(encoded, "`", "%60");
  encoded = replaceAll(encoded, "@", "%40");
  var dataUri = "data:image/svg+xml;charset=UTF-8," + encoded.trim();
  return dataUri;
}
